package com.proyecto.listadorol;

import com.proyecto.listadorol.models.PersonMin;

import org.junit.Test;

import static org.junit.Assert.*;

/**
 * Example local unit test, which will execute on the development machine (host).
 *
 * @see <a href="http://d.android.com/tools/testing">Testing documentation</a>
 */
public class ExampleUnitTest {
    @Test
    public void addition_isCorrect() {
        assertEquals(4, 2 + 2);
    }

    @Test
    public void check_name() {
        PersonMin p = new PersonMin();
        assertEquals(true, p.setPlayer_name("Avalon"));
        assertEquals(false, p.setPlayer_name(""));
    }

    @Test
    public void check_fecha() {
        PersonMin p = new PersonMin();

        assertEquals(p.setFecha("29/09/2020"), true);
        assertEquals(p.setFecha("29/02/2021"), false);
        assertEquals(p.setFecha("30/02/2080"), false);
        assertEquals(p.setFecha("Fecha"), false);
        assertEquals(p.setFecha(""), false);
    }


    @Test
    public void check_avatar_name() {
        PersonMin p = new PersonMin();
        assertEquals(true, p.setAvatar_name("Daniel"));
        assertEquals(true, p.setAvatar_name("Jose Manuel"));
        assertEquals(true, p.setAvatar_name("  Antonio"));
        assertEquals(false, p.setAvatar_name(""));
    }

    @Test
    public void check_imagen() {
        PersonMin p = new PersonMin();
        assertEquals(true, p.setImagen("data:image/png;base64,"));
        assertEquals(false, p.setImagen(""));
    }

    @Test
    public void check_Edad() {
        PersonMin p = new PersonMin();
        assertEquals(false, p.setEdad(10));
        assertEquals(true, p.setEdad(18));
        assertEquals(true, p.setEdad(0));
    }


    @Test
    public void check_personalidad() {
        PersonMin p = new PersonMin();
        assertEquals(true, p.setPersonalidad("Mi tarea es hacer un trabajo significativo. Hay algo en mi que me llama a hacer algo por este mundo. Doy mucha importancia a la tareas que hago y pongo mi empeño en hacerlas lo mejor posible. Mi trabajo es más que un servicio, es entregar mi corazón. Amo la efectividad y sacar las cosas adelante para aportar mi granito de arena. Mi problema es que me puedo obsesionar con las tareas y los objetivos que me propongo. Tiendo a trabajar demasiado y extenuarme, descuidando mis relaciones."));
        assertEquals(false, p.setPersonalidad(""));
    }


    @Test
    public void check_raza() {
        PersonMin p = new PersonMin();
        assertEquals(false, p.setRaza("enano"));
        assertEquals(true, p.setRaza("Gnomo"));
        assertEquals(true, p.setRaza("mediano"));
    }

}